import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
        <h1 class="victory">FERRARiROCHER</h1>

                <video autoplay muted loop id="myVideo">
  <source src="./video/treats_video.mp4" type="video/mp4"></source>
</video>

        </header>


      </div>
    );
  }
}

export default App;
